from math import log

'''
On calcul ici les temps de rouge de 0 à 10s
qu'on place dans une liste temps_r0
'''
temp_r0=[0]
for i in range(1,68) :
    temp_r0.append(log((i)/(0.003087)));
#print(temp_r0)

'''
On calcul ici les temps de vert de 0 à 10s
qu'on place dans une liste temps_v0
'''
temp_v0=[0]
for j in range(1,187) :
    temp_v0.append(log((j)/(0.008490)));
#print(temp_v0)

'''
On calcul ici les temps de bleu de 0 à 10s
qu'on place dans une liste temps_b0
'''

temps_b0=[]
for k in range(-243,0,1) :
    temps_b0.append(-log((k)/(-5352431)));
#print(temps_b0)

'''
On calcul ici les écarts de temps de rouge
qu'on place dans la liste temps_r'''
temps_r=[]
for i in range(len(temp_r0)-1):
    temps_r.append(temp_r0[i+1]-temp_r0[i])
#print(temps_r)

'''
On calcul ici les écarts de temps de vert
qu'on place dans la liste temps_v'''

temps_v=[]
for i in range(len(temp_v0)-1):
    temps_v.append(temp_v0[i+1]-temp_v0[i])
#print(temps_v)

'''
On calcul ici les écarts de temps de bleu
qu'on place dans la liste temps_b'''

temps_b=[]
for i in range(len(temps_b0)-1):
    temps_b.append(temps_b0[i+1]-temps_b0[i])
print(temps_b)

''' On fait la somme des valeurs dans une liste de temps 
pour bien vérifier que sa fait 10s'''

def somme(temps):
    a=0
    for i in range(len(temps)):
        a+=temps[i]
    return a
    
